B.a2T=new A.ct("\nCiao a tutti, sono Riccardo Debellini, studente al secondo anno del Liceo Bottoni di Milano.\n\nMi considero un ragazzo attivo e con la testa sulle spalle. La fisica mi appassiona, anche se con la matematica ho un rapporto di amore-odio (prof Montoli, mi perdoni!). Il mio pensiero \xe8 pi\xf9 logico che matematico, per questo l'informatica mi attrae in tutte le sue forme. \xc8 proprio questa passione che mi ha portato a entrare nel gruppo BinaryBears\n\nNon sono un grande fan dell'attivit\xe0 fisica, anche se pratico scherma. Ultimamente mi sono interessato al mondo dell'intelligenza artificiale, un campo che mi incuriosisce e che avr\xe0 sicuramente un ruolo importante nel mio futuro, qualsiasi esso sia.\n\nNella vita ho tanti sogni, sono un po' come un bambino in un negozio di caramelle! Mi piacerebbe diventare sviluppatore di app o giochi, pubblico ministero, medico, agente della sicurezza nazionale... le possibilit\xe0 sono infinite!\n\nSono sempre pronto a mettermi in gioco e ad affrontare nuove sfide. Il mio motto \xe8 \"carpe diem\": cogliere l'attimo e vivere al massimo ogni momento.\n",null,null,null)
